import logo from './MainLogo.svg';
import './App.css';
import './App.scss';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to my <span className='text-primary'>custom template</span><br/>Edit <code>src/App.js</code> and save to reload.
        </p>         
      </header>
    </div>
  );
}

export default App;
